import React from 'react';
import PropTypes from 'prop-types';

import '../../styles/ColorScheme.css';
import '../../styles/ElectionModal.css';

const propTypes = {
    election: PropTypes.object,
    onClose: PropTypes.func,
    show: PropTypes.bool
};

const defaultProps = {
    election: {},
    onClose: () => {},
    show: false
}

function ElectionModal(props) {
    const {
        election,
        onClose,
        show
    } = props;

    const modalVisibility = show ? "block" : "none";
    const animation = show ? " animate-in" : " animate-out";

    return (
        <div className={"election-modal-container" + animation} style={{ display: modalVisibility }}>
            <div className={"election-modal" + animation}>
                hello
            </div>
        </div>
    );
}

ElectionModal.propTypes = propTypes;
ElectionModal.defaultProps = defaultProps;
export default ElectionModal;
